import { LineChart, Line, XAxis, YAxis, Tooltip, Legend } from 'recharts'
const data = [
    { name: '11/2020', uv: 400, pv: 2400, amt: 2400 },
    { name: '12/2020', uv: 500, pv: 2400, amt: 2400 },
    { name: '01/2021', uv: 400, pv: 2400, amt: 2400 },
    { name: '02/2021', uv: 300, pv: 3400, amt: 3400 },
    { name: '03/2021', uv: 200, pv: 1400, amt: 3400 },
    { name: '04/2021', uv: 100, pv: 5400, amt: 3400 },
]

export default function Rechart() {
    return (
        <LineChart
            width={600}
            height={400}
            data={data}
            margin={{ top: 5, right: 20, bottom: 5, left: 0 }}
        >
            <Line type="monotone" dataKey="uv" stroke="#82ca9d" />
            <Line
                type="monotone"
                dataKey="pv"
                stroke="#8884d8"
                activeDot={{ r: 8 }}
            />
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
            <Legend />
        </LineChart>
    )
}
